    sw    $t2,  0($t0)

    addi  $t0,  $t0,  4
    addi  $t1,  $t1,  4
    addi  $t3,  $t3,  1

    bne   $t3,  16384,  draw_menu_loop    # 16384 is 128*128

    jr    $ra

